(8, 1, '2022-06-30 18:52:00', '2022-06-30 18:52:00', '<!-- wp:paragraph -->\n<p>About</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:cover {\"url\":\"http://localhost/wordpress/wp-content/uploads/2022/07/photo-1414235077428-338989a2e8c0-2.jpg\",\"id\":184,\"hasParallax\":true,\"dimRatio\":40,\"customOverlayColor\":\"#000000\",\"minHeight\":100,\"minHeightUnit\":\"vh\",\"contentPosition\":\"center center\",\"isDark\":false,\"align\":\"full\"} -->\n<div class=\"wp-block-cover alignfull is-light has-parallax\" style=\"background-image:url(http://localhost/wordpress/wp-content/uploads/2022/07/photo-1414235077428-338989a2e8c0-2.jpg);min-height:100vh\"><span aria-hidden=\"true\" class=\"wp-block-cover__background has-background-dim-40 has-background-dim\" style=\"background-color:#000000\"></span><div class=\"wp-block-cover__inner-container\"><!-- wp:heading {\"style\":{\"typography\":{\"fontSize\":\"48px\",\"lineHeight\":\"1.2\"}},\"className\":\"alignwide has-white-color has-text-color\"} -->\n<h2 class=\"alignwide has-white-color has-text-color\" style=\"font-size:48px;line-height:1.2\"><strong><em>Overseas:</em></strong><br><strong><em>1500 â€” 1960</em></strong></h2>\n<!-- /wp:heading -->\n\n<!-- wp:columns {\"align\":\"wide\"} -->\n<div class=\"wp-block-columns alignwide\"><!-- wp:column {\"width\":\"60%\"} -->\n<div class=\"wp-block-column\" style=\"flex-basis:60%\"><!-- wp:paragraph {\"style\":{\"color\":{\"text\":\"#ffffff\"}}} -->\n<p class=\"has-text-color\" style=\"color:#ffffff\">An exhibition about the different representations of the ocean throughout time, between the sixteenth and the twentieth century. Taking place in our Open Room in <em>Floor 2</em>.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:buttons -->\n<div class=\"wp-block-buttons\"><!-- wp:button {\"style\":{\"color\":{\"text\":\"#ffffff\",\"background\":\"#000000\"}},\"className\":\"is-style-outline\"} -->\n<div class=\"wp-block-button is-style-outline\"><a class=\"wp-block-button__link has-text-color has-background\" style=\"background-color:#000000;color:#ffffff\">Visit</a></div>\n<!-- /wp:button --></div>\n<!-- /wp:buttons --></div>\n<!-- /wp:column -->\n\n<!-- wp:column -->\n<div class=\"wp-block-column\"></div>\n<!-- /wp:column --></div>\n<!-- /wp:columns --></div></div>\n<!-- /wp:cover -->\n\n<!-- wp:heading {\"textAlign\":\"center\"} -->\n<h2 class=\"has-text-align-center\">Our Staff</h2>\n<!-- /wp:heading -->\n\n<!-- wp:separator -->\n<hr class=\"wp-block-separator has-alpha-channel-opacity\"/>\n<!-- /wp:separator -->\n\n<!-- wp:group {\"layout\":{\"type\":\"flex\",\"flexWrap\":\"nowrap\"}} -->\n<div class=\"wp-block-group\"><!-- wp:freeform -->\n<div class=\"wp-block-mdlr-static-jsx-example card\"><img class=\"custom_image_class\" style=\"height: 120; width: 250px;\" src=\"http://localhost/wordpress/wp-content/uploads/2022/07/Capture.png\" />\n<p>Â </p>\n<h4>Florentina</h4>\n<h4>ReshaniÂ </h4>\n<p>Resposible for creatingÂ  yummy food!</p>\n<div style=\"margin: 24px 0;\">Â </div>\n<p><a class=\"button\" style=\"color: #ffffff; background-color: #000;\">Contact</a></p>\n</div>\n<!-- /wp:freeform -->\n\n<!-- wp:freeform -->\n<div class=\"wp-block-mdlr-static-jsx-example card\"><img class=\"custom_image_class\" style=\"height: 120; width: 250px;\" src=\"http://localhost/wordpress/wp-content/uploads/2022/07/Capture.png\" />\n<p>Â </p>\n<h4>Fortesa</h4>\n<h4>Hoti</h4>\n<p>Resposible for creatingÂ  yummy food!</p>\n<div style=\"margin: 24px 0;\">Â </div>\n<p><a class=\"button\" style=\"color: #ffffff; background-color: #000;\">Contact</a></p>\n</div>\n<!-- /wp:freeform -->\n\n<!-- wp:freeform -->\n<div class=\"wp-block-mdlr-static-jsx-example card\"><img class=\"custom_image_class\" style=\"height: 120; width: 250px;\" src=\"http://localhost/wordpress/wp-content/uploads/2022/07/Capture.png\" />\n<p>Â </p>\n<h4>Elhami</h4>\n<h4>Musliu</h4>\n<p>Resposible for creatingÂ  yummy food!</p>\n<div style=\"margin: 24px 0;\">Â </div>\n<p><a class=\"button\" style=\"color: #ffff